import{_ as e,a,b as t,c as r,d as i}from"./chunks/rtk_fem_fb_2.j1iLjbtY.js";import{_ as o,c as n,o as s,ab as l}from"./chunks/framework.CUflZczI.js";const v=JSON.parse('{"title":"Femtones MINI2 Receiver","description":"","frontmatter":{},"headers":[],"relativePath":"en/gps_compass/rtk_gps_fem_mini2.md","filePath":"en/gps_compass/rtk_gps_fem_mini2.md"}'),c={name:"en/gps_compass/rtk_gps_fem_mini2.md"},p=l('<h1 id="femtones-mini2-receiver" tabindex="-1">Femtones MINI2 Receiver <a class="header-anchor" href="#femtones-mini2-receiver" aria-label="Permalink to &quot;Femtones MINI2 Receiver&quot;">​</a></h1><p><a href="http://www.femtomes.com/#/MiniII?type=0" target="_blank" rel="noreferrer">MINI2 Receiver</a> is an RTK GPS receiver that delivers high-rate and reliable RTK initialization for centimeter level positioning. It is intended for applications that require high-precision positioning (e.g. navigation and mapping, etc.).</p><p>The receiver is connected to PX4 via a serial port (UART) and may be configured over Ethernet using a standard web browser.</p><p><img src="'+e+'" alt="MINI II Receiver"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>PX4 drivers for Ethernet, CAN and USB are under development.</p></div><h2 id="required-firmware-options" tabindex="-1">Required Firmware Options <a class="header-anchor" href="#required-firmware-options" aria-label="Permalink to &quot;Required Firmware Options&quot;">​</a></h2><p>The following firmware options need to be selected when buying the device:</p><ul><li>5Hz, 10Hz, 20Hz</li><li>INS</li><li>HEADING</li><li>OBS</li><li>RTK</li><li>BASE</li></ul><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><p>Contact <a href="http://www.femtomes.com/" target="_blank" rel="noreferrer">Femtones</a> directly for sales quote:</p><ul><li><strong>Email:</strong> <a href="mailto:sales@femtomes.com" target="_blank" rel="noreferrer">sales@femtomes.com</a></li><li><strong>Telephone:</strong> +86-10-53779838</li></ul><h2 id="functional-ports" tabindex="-1">Functional Ports <a class="header-anchor" href="#functional-ports" aria-label="Permalink to &quot;Functional Ports&quot;">​</a></h2><p><img src="'+a+'" alt="MINI II 1"></p><h2 id="wiring-and-connections" tabindex="-1">Wiring and Connections <a class="header-anchor" href="#wiring-and-connections" aria-label="Permalink to &quot;Wiring and Connections&quot;">​</a></h2><p>The <a href="http://www.femtomes.com" target="_blank" rel="noreferrer">MINI2 Receiver</a> is connected to a UART on the flight controller (GPS port) for data. To power the module you will need a separate 12V power supply. The pins on the 12-pin connector are numbered as shown below.</p><p><img src="'+t+'" alt="MINI_II_2"></p><h2 id="configuration" tabindex="-1">Configuration <a class="header-anchor" href="#configuration" aria-label="Permalink to &quot;Configuration&quot;">​</a></h2><p>For heading estimation the two antennas need to be on the same level and at least 30 cm apart from each other. The direction that they are facing does not matter as it can be configured with the <a href="./../advanced_config/parameter_reference.html#GPS_YAW_OFFSET">GPS_YAW_OFFSET</a> parameter.</p><p>Configure the serial port on which the <a href="http://www.femtomes.com/#/MiniII?type=0" target="_blank" rel="noreferrer">MINI2 Receiver</a> will run using <a href="./../advanced_config/parameter_reference.html#GPS_1_CONFIG">GPS_1_CONFIG</a>, and set the baud rate to 115200 using <a href="./../advanced_config/parameter_reference.html#SER_GPS1_BAUD">SER_GPS1_BAUD</a>.</p><p>Once configured the receiver is used in the same way as any other <a href="./../gps_compass/rtk_gps.html">RTK GPS</a> (i.e. with respect to the Survey-in process).</p><h2 id="additional-information" tabindex="-1">Additional Information <a class="header-anchor" href="#additional-information" aria-label="Permalink to &quot;Additional Information&quot;">​</a></h2><p>The MINI2 incorporates the following components:</p><ul><li><p><a href="http://www.femtomes.com/#/FB672" target="_blank" rel="noreferrer">FB672</a>: Compact, dual antenna, dual frequency GNSS OEM board (delivers centimeter accurate position and precise heading).</p><p><img src="'+r+'" alt="FB672"></p></li><li><p><a href="http://www.femtomes.com/#/FB6A0" target="_blank" rel="noreferrer">FB6A0</a>: Compact, quadruple frequency GNSS OEM board (delivers centimeter-accurate positioning)</p><p><img src="'+i+'" alt="FB6A0"></p></li></ul><p>Detailed product instructions can be obtained on the official website or by contacting us.</p>',24),h=[p];function m(d,f,_,u,g,b){return s(),n("div",null,h)}const S=o(c,[["render",m]]);export{v as __pageData,S as default};
